import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import './App.css';

import LoginPage from './pages/LoginPage'

function App() {
  return (
    <Router>
      <Switch>
        <Route render={(props) => {
          return <LoginPage {...props} />
        }}/>
      </Switch>
    </Router>
  );
}

export default App;
